import React from "react"
import TodoItem from "./TodoItem"
import todosData from "./todosData"

function ListApp() {
	const todoItems = todosData.map()

	return (
		<div className="todo-list">
			<TodoItem />
			<TodoItem />
			<TodoItem />
			<TodoItem />
        </div>
	)
}

export default ListApp
